import React from "react";
import {Card, Carousel} from "react-bootstrap";
// import axios from "axios";
import "./card.css";

const Car = (props) => {
return (
  <div>
    <br/>
  <Card style={{ width: "22rem" }}>
  <Card.Body>
  <Card.Title>Nyleesia Nicome Schnarr</Card.Title>
  <Card.Subtitle className="mb-2 text-muted">Web Developer</Card.Subtitle>
     <Card.Text>
    Phone: 517-507-1232
    Email: nyleesia.nicome@gmail.com
    </Card.Text>
    <Card.Link href="https://www.linkedin.com/in/nyleesia">LinkedIn</Card.Link>
    <Card.Link href="https://www.facebook.com/Nyleesia">FaceBook</Card.Link>
    </Card.Body>
  </Card>
  </div>
)
  
}

export default Car;
